exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog");return parseCatalog(`https://tingbook.cc/show/${bid}.html`,{cleaner:html=>cleanCatalogWrapper(html,/id="yuedu"[^>]*>/,"</ul>"),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions)}})};